import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";



function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          < Home />
        </Route>
        <Route exact path="/login">
          < Login />
        </Route>
        <Route path="/register">
          < Register />
        </Route>
        <Route path="/perfil">
          < Perfil />
        </Route>
        <Route path="/about">
          < About />
        </Route>
      </Switch>
    </Router>
  );
}
